import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
function App() {
  return (
    <div className="container">
      <div className="row">
        <div className="col-6">c1</div>
        <div className="col-6">c2</div>
        <span>
          <i className="fas fa-home" />
        </span>
      </div>
    </div>
  );
}

export default App;
